import React from 'react';
import "./CSS/Login.css";

function Login() {
  return (

    <div className="login__wrapper">
<div className="login">
    <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/6b/WhatsApp.svg/479px-WhatsApp.svg.png" alt="" srcset="" />
    <h2>Sign in to WhatsApp</h2>
    <button>Login with Gmail</button>
</div>
    </div>
    
  )
}

export default Login
